import './App.css';
import { BrowserRouter as Router, Switch, Route } from 'react-router-dom';
import Header from './containers/ProductDetail';
import ProductListng from './containers/ProductListing';

function App() {
  return (
    <div className="App">
      <Router>
        <Header />
        <Route path='/' exact component={ProductListng} />  
      </Router>
    </div>
  );
}

export default App;
